import React from 'react';
import './App.css';
import BlogMessages from './components/BlogMessages';
import { Provider } from 'react-redux';
import { store } from './actions/store';

function App() {
  return (
    <Provider store={store}>

      <BlogMessages />
    </Provider>
  );
}

export default App;
